import React from "react";
import styled from "styled-components";
import Avatar from "../../Components/Avatar";

const Wrapper = styled.div`
  min-height: 100vh;
`;

const ImgPart = styled.div`
  background-color: white;
`;

export default ({
  id,
  username,
  avatar,
  location,
  isLiked,
  files,
  likeCount,
  comments
}) => {
  return (
    <Wrapper>
      <Avatar size="md" url={avatar} />
    </Wrapper>
  );
};
